import React, { Component } from 'react'

class Sell extends Component{
    render(){
        return(
            <div className='APP'>
                这是王冠的销售管理,可以从作物的销售品种(大豆、花生...)、销售吨数、销售时间等入手
            </div>
        )
    }
}
export default Sell
